import React from "react";

export default function video(props) {
  return (
    <>
      <div className="video">
        <video
          className="video__playing"
          poster={props.mainVideo.video}
          controls
        ></video>
      </div>
      <div className="video__info">
        <h1 className="video__title">{props.mainVideo.title}</h1>
        <div>
          <p className="video__channel">{props.mainVideo.title}</p>
          <p></p>
          <p></p>
          <p></p>
        </div>
      </div>
    </>
  );
}
